  }));
};

UilBoltSlash.propTypes = {
  color: PropTypes.string,
  size: PropTypes.oneOfType([PropTypes.string, PropTypes.number]),
};

UilBoltSlash.defaultProps = {
  color: 'currentColor',
  size: '24',
};

export default UilBoltSlash;
